import * as React from 'react'
import { Box } from '@mui/system';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';

import {
  BrowserRouter as Router,
  Route,
  Routes,
  Outlet,
  Link
} from "react-router-dom";

import Home from "./pages/Home";
import Blogs from "./pages/Blogs";
import About from "./pages/About";
import HistoryOfCS from "./pages/blogs/HistoryOfCS"
import ISCD from "./pages/blogs/ISCD"
import UsesOfComputerSystem from "./pages/blogs/UsesOfComputerSystem"
import NumberSystem from "./pages/blogs/NumberSystem"
import ComputerComponentsAndOSs from "./pages/blogs/ComputerComponentsAndOSs"

const style = {
  textDecoration:'none',
  marginRight: 10,
  fontSize:25,
  color: 'black'
};
const box = {
  p: 3, 
  borderRadius:2.5, 
  borderBottom:1.5, 
  bgcolor: '#e6e6e6'
};

const [anchorEl, setAnchorEl] = React.useState<null | HTMLElement>(null);
const open = Boolean(anchorEl);
const handleClick = (event: React.MouseEvent<HTMLElement>) => {
  setAnchorEl(event.currentTarget);
};
const handleClose = () => {
  setAnchorEl(null);
};

function App() {
  return (
    <div style={{textAlign:'center'}}>
          <Router>
            <Routes>
              <Route path="/" element={<Layout/>}>
                <Route index element={<Home/>}/>
                <Route path="/blogs" element={<Blogs/>}/>
                <Route path="/about" element={<About/>}/>

                <Route path="/HistoryOfCS" element={<HistoryOfCS/>}/>
                <Route path="/ISCD" element={<ISCD/>}/>
                <Route path="/UsesOfComputerSystem" element={<UsesOfComputerSystem/>}/>
                <Route path="/NumberSystem" element={<NumberSystem/>}/>
                <Route path="/ComputerComponentsAndOSs" element={<ComputerComponentsAndOSs/>}/>

              </Route>
            </Routes>
          </Router>
    </div>
  );
}
const Layout = () => {
  //Top bsr with links
  return (
    <div>
      <Box component="section" sx={box}>
        <Link to="/" style={style}>Home</Link>
        <Link to="/blogs" style={style}>Blogs</Link>

        <Button
          id="demo-positioned-button"
          aria-controls={open ? 'demo-positioned-menu' : undefined}
          aria-haspopup="true"
          aria-expanded={open ? 'true' : undefined}
          onClick={handleClick}
        >
            Drop down Blogs Test
        </Button>
        <Menu
          id="demo-positioned-menu"
          aria-labelledby="demo-positioned-button"
          anchorEl={anchorEl}
          open={open}
          onClose={handleClose}
          anchorOrigin={{
            vertical: 'top',
            horizontal: 'left',
          }}
          transformOrigin={{
            vertical: 'top',
            horizontal: 'left',
          }}
        >
          <MenuItem onClick={handleClose}>Profile</MenuItem>
          <MenuItem onClick={handleClose}>My account</MenuItem>
          <MenuItem onClick={handleClose}>Logout</MenuItem>
        </Menu>
        <Link to="/about" style={style}>About</Link>
      </Box>
      <Outlet/>
    </div>

  )
};
export default App;
